import React from 'react';
import { Link } from 'react-router-dom'
import FacebookIcon from '@material-ui/icons/Facebook';
import InstagramIcon from '@material-ui/icons/Instagram';
import LinkedInIcon from '@material-ui/icons/LinkedIn';
import GitHubIcon from '@material-ui/icons/GitHub';


const Covid19 = () => {
    return (
        <>
        <div className='brand_name'>
        <div className='svg'>
          <img src='./healthify.svg' alt=''/>
          </div>
          <div className='logos'>
                <Link to='/facebook' className='main_logos'><FacebookIcon /></Link>
                <Link to='/instagram' className='main_logos'><InstagramIcon /></Link>
                <Link to='/linkedin' className='main_logos'><LinkedInIcon /></Link>
                <Link to='/github' className='main_logos'><GitHubIcon /></Link>
          </div>
          </div>
          
        </>
    )
}

export default Covid19
